import React from 'react';
import logo from './logo.svg';
import './App.css';
import Menu from './components/menu';
import { PLACES } from './shared/places';
import {BrowserRouter as Router,Route, Link,} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Nav,Navbar, NavbarBrand, NavbarNav, NavbarToggler, Collapse, NavItem, NavLink, Dropdown, DropdownToggle, DropdownMenu, DropdownItem } from 'react-bootstrap';
import { Button, Form, FormControl, ControlLabel } from "react-bootstrap";
import PostPage from "./PostPage";

class MyNavbar extends React.Component {
  constructor(props) {
      super(props);
      this.state = {
          collapse: false,
          isWideEnough: false,
          dropdownOpen: false
      };
  this.onClick = this.onClick.bind(this);
  this.toggle = this.toggle.bind(this);
  }

  onClick(){
      this.setState({
          collapse: !this.state.collapse,
      });
  }

  toggle() {
      this.setState({
          dropdownOpen: !this.state.dropdownOpen
      });
  }

  render() {
      return (
          <Router>
              <Navbar color="indigo" dark expand="md" scrolling>
                  <NavbarBrand href="/">
                      <strong>Navbar</strong>
                  </NavbarBrand>
                  { !this.state.isWideEnough && <NavbarToggler onClick = { this.onClick } />}
                  <Collapse isOpen = { this.state.collapse } navbar>
                      <NavbarNav left>
                        <NavItem active>
                            <NavLink to="#">Home</NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink to="#">Features</NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink to="#">Pricing</NavLink>
                        </NavItem>
                        <NavItem>
                            <Dropdown isOpen={this.state.dropdownOpen} toggle={this.toggle}>
                            <DropdownToggle nav caret>Dropdown</DropdownToggle>
                            <DropdownMenu>
                                <DropdownItem href="#">Action</DropdownItem>
                                <DropdownItem href="#">Another Action</DropdownItem>
                                <DropdownItem href="#">Something else here</DropdownItem>
                                <DropdownItem href="#">Something else here</DropdownItem>
                            </DropdownMenu>
                            </Dropdown>
                        </NavItem>
                      </NavbarNav>
                      <NavbarNav right>
                        <NavItem>
                          <form className="form-inline md-form mt-0">
                            <input className="form-control mr-sm-2 mb-0 text-white" type="text" placeholder="Search" aria-label="Search"/>
                          </form>
                        </NavItem>
                      </NavbarNav>
                  </Collapse>
              </Navbar>
          </Router>
      );
  }
}

class App extends React.Component {					

	constructor(props){
		super(props);

		this.state = {
			places: PLACES
		};
	}

	render(){
		return (
			<div className='App'>
        <MyNavbar/>
				<h1>Upcoming Events</h1>
				<Menu places={this.state.places} />

			</div>
		);
	}
}

export default App;
